using TShockAPI;

namespace Skynomi.Web
{
    public abstract class WebPage
    {
        private static object data = PlayerData.GetData();

        private static int AverageBalance()
        {
            try
            {
                data = PlayerData.GetData();
                int total = 0;
                if (((dynamic)data).data.Count > 0)
                {
                    foreach (var item in ((dynamic)data).data)
                    {
                        total += item.Balance;
                    }

                    return total / ((dynamic)data).data.Count;
                }
                else
                {
                    return -1;
                }
            }
            catch (Exception ex)
            {
                Utils.Log.Error(ex.ToString());
                return -1;
            }
        }

        private static string TopRank()
        {
            try
            {
                Dictionary<int, string> rank = new Dictionary<int, string>();
                if (((dynamic)data).data is List<PlayerData.Data> { Count: > 0 } playerList)
                {
                    foreach (var item in playerList)
                    {
                        if (item.Rank?.GetType().GetProperties().Length > 0)
                        {
                            rank[item.Rank.Rank] = item.Rank.Name;
                        }
                    }

                    return rank.Count == 0 ? "N/A" : rank[rank.Keys.Max()];
                }
                else
                {
                    return "N/A";
                }
            }
            catch (Exception ex)
            {
                Utils.Log.Error(ex.ToString());
                return "N/A";
            }
        }

        private static string Statistic()
        {
            try
            {
                string html = "";
                int counter = 0;
                if (((dynamic)data).data is List<PlayerData.Data> { Count: > 0 } playerList)
                {
                    foreach (var item in playerList)
                    {
                        counter++;
                        string device = item.Device.ToLower();
                        string deviceIcon = device switch
                        {
                            "mobile" => "smartphone",
                            "pc" => "computer",
                            "xbox" => "gamepad-2",
                            _ => "file-question"
                        };

                        html += @$"
                        <tr class='border-b'>
                            <td class='py-2 px-4'>{counter}</td>
                            <td class='py-2 px-4'>{item.Username}</td>
                            <td class='py-2 px-4'><i data-lucide={deviceIcon}></i></td>
                            <td class='py-2 px-4'>{item.Balance}</td>
                            <td class='py-2 px-4'>{(item.Rank?.Rank == 0 || item.Rank?.Rank == -1 ? "N/A" : item.Rank?.Name)}</td>
                        </tr>
                    ";
                    }

                    return html;
                }

                return @"
                    <tr>
                        <td colspan='5' class='py-6 text-center text-gray-500 italic'>No player online</td>
                    </tr>";
            }
            catch (Exception ex)
            {
                Utils.Log.Error(ex.ToString());
                return "N/A";
            }
        }

        private static string Auction()
        {
            try
            {
                if (Database.CacheManager.GetAllCacheKeys().Contains("Auctions"))
                {
                    string html = @"
                        <h1 class='text-3xl font-bold text-gray-800 mt-10'>Auctions</h1>
                        <table class='w-full mt-4 bg-white shadow-md rounded-lg overflow-hidden border border-gray-300'>
                            <thead class='bg-gray-300 text-gray-700 uppercase text-sm'>
                                <tr>
                                    <th class='py-3 px-4 text-left'>#</th>
                                    <th class='py-3 px-4 text-left'>Username</th>
                                    <th class='py-3 px-4 text-left'>Item Name</th>
                                    <th class='py-3 px-4 text-left'>Price</th>
                                    <th class='py-3 px-4 text-left'>Amount</th>
                                </tr>
                            </thead>
                                <tbody id='auction-list' class='text-gray-700'>
                    ";
                    dynamic[] auctions = Database.CacheManager.Cache.GetCache<dynamic>("Auctions").GetAllValues().Select(e => new { e.Username, ItemName = TShock.Utils.GetItemById((int)e.ItemId)?.Name ?? "Unknown", e.Price, e.Amount }).Cast<object>().ToArray();
                    if (auctions.Length > 0)
                    {
                        int counter = 0;
                        foreach (var e in auctions)
                        {
                            counter++;
                            html += @$"
                            <tr class='border-b'>
                                <td class='py-2 px-4'>{counter}</td>
                                <td class='py-2 px-4'>{e.Username}</td>
                                <td class='py-2 px-4'>{e.ItemName}</td>
                                <td class='py-2 px-4'>{e.Price}</td>
                                <td class='py-2 px-4'>{e.Amount}</td>
                            </tr>
                        ";
                        }
                    }
                    else
                    {
                        html += @"
                            <tr>
                                <td colspan='5' class='py-6 text-center text-gray-500 italic'>No auction available</td>
                            </tr>
                        ";
                    }

                    html += @"
                    </tbody>
                    </table>";

                    return html;
                }
                return "";
            }
            catch (Exception ex)
            {
                Utils.Log.Error(ex.ToString());
                return "";
            }
        }

        public static string HomePage() => @$"
        <!DOCTYPE html>
        <html lang='en'>
